    const [notes, setNotes] = useState([])

    function handleCreate(fullNote) {
        setNotes(prevValue => {
            return {
                ...prevValue,
                fullNote
            }
        })
        
    }
    console.log(notes)
    return (
        <div>
            <h1>Hello world</h1>
            <CreateNote onAdd={handleCreate}/>
        </div>
    )
}

export default App;
